import React from 'react'
import { useState } from 'react';
import { Form, FormLayout, TextField, Button } from '@shopify/polaris'

const Register = () => {
  const [nameStore, setNameStore ] = useState();
  const [email, setEmail ] = useState();
  const [nameRepresentated, setNameRepresentated ] = useState();
  const [creditCard, setCreditCard ] = useState();
  const [phone, setPhone ] = useState();

  handleSubmit = (e) => {
    e.preventDefault();
    alert(`Datos ${nameStore} ${email} ${nameRepresentated} ${creditCard} ${phone}`);
  }
  

  return (
    <Form onSubmit={handleSubmit}>
      <FormLayout>          
          <TextField
              value={nameStore}
              onChange={e => setNameStore(e.target.value)}
              label="Nombre de la tienda"
              type="text"            
          />
          <TextField
              value={email}
              onChange={e => setEmail(e.target.value)}
              label="Email"
              type="email"            
          />
        <TextField
          value={nameRepresentated}
          onChange={e => setNameRepresentated(e.target.value)}
          label="Nombre del representante legal"
          type="text"            
        />
        <TextField
          value={creditCard}
          onChange={e => setCreditCard(e.target.value)}
          label="Opcional (Tarjeta de crÃ©dito)"
          type="text"            
        />
        <TextField
          value={phone}
          onChange={e => setPhone(e.target.value)}
          label="Telefono"
          type="number"            
        />
        <Button fullWidth primary submit>Guardar</Button>
      </FormLayout>
    </Form>
  );
}


export default Register;
